import axios from 'axios';
import { Link } from 'react-router-dom';
import React, { useEffect, useState } from 'react';
import { Card, Button, Grid } from 'semantic-ui-react';

export default function ReadDataCards() {
  const [APIData, setAPIData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:7777/api/Ayuda').then((response) => {
      setAPIData(response.data);
    });
  }, []);

  const onDelete = (_id) => {
    axios
      .delete(`http://localhost:7777/api/Reportes/${_id}`)
      .then(() => {
        getData();
      })
      .catch((error) => {
        console.error('Error al eliminar el elemento:', error);
      });
  };

  return (
    <div>
      <h1 className="titulo">Reportes</h1>
      <Grid columns={3}>
        {APIData.map((data) => (
          <Grid.Column key={data._id}>
            <Card fluid>
              <Card.Content>
                <Card.Header>{data.indicador}</Card.Header>
                <Card.Meta>{data.categoria}</Card.Meta>
                <Card.Description>{data.descripcion}</Card.Description>
                <Card.Meta>Fecha Inicio: {data.fecha_inicio}</Card.Meta>
                <Card.Meta>Fecha Terminaci√≥n: {data.fecha_terminacion}</Card.Meta>
                <Card.Meta>Empresa: {data.responsable}</Card.Meta>
                <Card.Meta>Estado: {data.estado}</Card.Meta>
                <Card.Meta>Comentarios: {data.comentarios}</Card.Meta>
              </Card.Content>
              <Card.Content extra>
                <div className="ui two buttons">
                  <Link to="/updateReportes">
                    <Button
                      className="CreateUpdate"
                      onClick={() => setData(data)}
                    >
                      Actualizar
                    </Button>
                  </Link>
                  <Button
                    className="CreateDelete"
                    onClick={() => onDelete(data._id)}
                  >
                    Eliminar
                  </Button>
                </div>
              </Card.Content>
            </Card>
          </Grid.Column>
        ))}
      </Grid>
    </div>
  );
}
